import styled from 'styled-components';

export const LandContainer = style.div`
  display: flex;
  flex-wrap: wrap;

  > div {
    width: 200px;
    margin-right: 30px;

    > div.land-card-img {
      width: 100%;
      height: 200px;
      background-color: red;
    }
  }
`;
